import React from 'react';
import Header from './Header';
import Main from './Main';
import './App.css';
import './index.css';

function App() {
  return (
    <div>
        <header className="App">
          <h2>Eco-Via</h2>
        </header>

        <body>
          <main>
          <form>
                <label>
                  Nome:
                  <input type="text" name="name" />
                </label>
                <input type="submit" value="Enviar" />
              </form>
          </main>
        </body>
    </div>
  );
}

export default App;
